import React from 'react';
import s from './Category.module.css'

const Category = (props) => {
    return (
        <div>
            <h3>Выберите категорию</h3>
            <div className={s.categories}>
                <div className={s.category}>
                    <div>1</div>
                    <div>2</div>
                    <div>3</div>
                </div>
            </div>
        </div>
    );
};

export default Category;
